const Contact = () => {
  return (
    <div className='contect'>
      <h1 style={{color:"black"}}>For any questions please drop a mail</h1> <br />  
      <h1 style={{color:"blue"}}><a href="https://krishm9294@gmail.com">krishm9294@gmail.com</a> </h1> <br />
      <p>or</p> <br />
      <h1 style={{color:"blue"}}>     <a href="+91 9294854345">9294854345</a> </h1>
      
    </div>
  )
}

export default Contact
